import React, {useState} from 'react';
import Teammates from "./List.js";
import Form from "./Form.js";
import './App.css';

function App() {
  const [team, setTeam] = useState([]);


  return (
    <div>
      <Form team={team} setTeam={setTeam} />
    </div>
  );
}

export default App;
